import React, { useContext, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "../styles/Header.css";
import AuthContext from "../AuthContext";

const Header = () => {
  const { user, logout } = useContext(AuthContext);
  const navigate = useNavigate();
  const [searchTerm, setSearchTerm] = useState("");

  const handleSearch = (e) => {
    e.preventDefault();
    if (searchTerm.trim()) {
      navigate(`/products/search/${searchTerm}`);
    }
  };

  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark fixed-top shadow-lg">
      <div className="container">
        {/* Logo */}
        <Link className="navbar-brand fw-bold fs-3 logo" to="/dashboard">
          E-Mart
        </Link>

        {/* Navbar Toggle for Mobile */}
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNav"
          aria-controls="navbarNav"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>

        <div className="collapse navbar-collapse justify-content-between" id="navbarNav">
          {/* Left Section - Links */}
          <ul className="navbar-nav">
            <li className="nav-item">
              <Link className="nav-link fs-5 px-3" to="/dashboard">Home</Link>
            </li>

            {/* Categories Dropdown */}
            <li className="nav-item dropdown">
              <a className="nav-link dropdown-toggle fs-5 px-3" href="#" role="button" data-bs-toggle="dropdown">
                Categories
              </a>
              <ul className="dropdown-menu">
                <li><Link className="dropdown-item" to="/categorylist">All Categories</Link></li>
                <li><Link className="dropdown-item" to="/products/category/electronics">Electronics</Link></li>
                <li><Link className="dropdown-item" to="/products/category/clothing">Clothing</Link></li>
                <li><Link className="dropdown-item" to="/products/category/home">Home & Kitchen</Link></li>
              </ul>
            </li>

            {/* Orders */}
            <li className="nav-item">
              <Link className="nav-link fs-5 px-3" to="/orders">Orders</Link>
            </li>
          </ul>

          {/* Search Bar */}
          <form className="d-flex search-form" onSubmit={handleSearch}>
            <input
              className="form-control me-2"
              type="search"
              placeholder="Search for products..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
            />
            <button className="btn btn-outline-light" type="submit">Search</button>
          </form>

          {/* Right Section - Auth Buttons */}
          <div className="auth-section">
            {user ? (
              <div className="dropdown">
                <button className="btn btn-light dropdown-toggle fw-bold" type="button" data-bs-toggle="dropdown">
                  {user.email}
                </button>
                <ul className="dropdown-menu">
                  <li><Link className="dropdown-item" to="/profile">Profile</Link></li>
                  <li><button className="dropdown-item text-danger" onClick={logout}>Logout</button></li>
                </ul>
              </div>
            ) : (
              <button className="btn btn-light fw-bold" onClick={() => navigate("/login")}>
                Login
              </button>
            )}
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Header;
